#include<bits/stdc++.h>
using namespace std;

class Solution {
public:
    string removeStars(string s) {

        int lastChar=0,it=0;

        //scan and copy. If * found, replace last char with subsequent non-star char
        while (it <s.size()){

            if (s[it] !='*'){
                s[lastChar] = s[it]; 
                lastChar++; it++;
            }
            else{
                lastChar--; it++;
            }  
        }
        return s.substr(0,lastChar);
    }
};


